import{_ as e,o as r,c as o,ah as n}from"./chunks/framework.PKn7PQPU.js";const m=JSON.parse('{"title":"Error Codes","description":"","frontmatter":{"pageClass":"doc-wide-view"},"headers":[],"relativePath":"en/wasm/info/errorInfo.md","filePath":"en/wasm/info/errorInfo.md"}'),i={name:"en/wasm/info/errorInfo.md"};function d(a,t,s,c,h,g){return r(),o("div",null,[...t[0]||(t[0]=[n('<h1 id="error-codes" tabindex="-1">Error Codes <a class="header-anchor" href="#error-codes" aria-label="Permalink to &quot;Error Codes&quot;">​</a></h1><p>When the TechUI <strong>Guard</strong> detects an anomaly, it triggers console warnings or a full-screen meltdown based on the severity of the error.</p><p>In the meltdown interface or via the <code>tuiCoreInfo()</code> query, you can view the <code>VALIDSTATUS</code> object. A key value of <code>false</code> indicates that the specific check <strong>failed</strong>.</p><h2 id="authorization-expiration" tabindex="-1">Authorization &amp; Expiration <a class="header-anchor" href="#authorization-expiration" aria-label="Permalink to &quot;Authorization &amp; Expiration&quot;">​</a></h2><p>These errors relate to the validity, version, or trial limits of your license.</p><table tabindex="0"><thead><tr><th>Error Code</th><th>Meaning</th><th>Solution</th></tr></thead><tbody><tr><td><strong>dateValid</strong></td><td><strong>Primary license expired</strong>. System time exceeds the license <code>expDate</code>.</td><td>Contact business support to renew and get a new License String.</td></tr><tr><td><strong>subLicDateValid</strong></td><td><strong>Sub-license expired</strong>. The developer license distributed to the end customer has expired.</td><td>Generate a new sub-license string for the customer.</td></tr><tr><td><strong>tempKey</strong></td><td><strong>Trial time exhausted</strong>. Advanced components used in free/trial mode; 10-minute countdown ended.</td><td>Refresh the page to reset the timer or purchase a formal license.</td></tr><tr><td><strong>version</strong></td><td><strong>Version incompatibility</strong>. Library version (e.g., v1.5) is higher than the license version constraint (e.g., v1.0).</td><td>1. Upgrade license; 2. Downgrade library to a supported range.</td></tr></tbody></table><h2 id="environment-binding" tabindex="-1">Environment &amp; Binding <a class="header-anchor" href="#environment-binding" aria-label="Permalink to &quot;Environment &amp; Binding&quot;">​</a></h2><p>Triggered when the running environment does not match the license configuration.</p><table tabindex="0"><thead><tr><th>Error Code</th><th>Meaning</th><th>Solution</th></tr></thead><tbody><tr><td><strong>domainName</strong></td><td><strong>Domain validation failed</strong>. Current <code>hostname</code> is not in the license whitelist.</td><td>Check deployment domain or contact support to add the domain to the whitelist.</td></tr><tr><td><strong>project</strong></td><td><strong>Project name mismatch</strong>. <code>projectBind</code> is enabled, but <code>document.title</code> does not contain the required project name.</td><td>Update the HTML <code>&lt;title&gt;</code> tag to include the project name specified in the license.</td></tr><tr><td><strong>deployLocation</strong></td><td><strong>Deployment violation</strong>. License restricted to <code>localOnly</code> (intranet), but public network detected.</td><td>Ensure deployment is on intranet IPs or private clouds, or upgrade to a general license.</td></tr><tr><td><strong>platform</strong></td><td><strong>Platform type error</strong>. Running TechUI Prime on TechUI Sass (or vice versa).</td><td>Ensure the library version matches the purchased platform type.</td></tr></tbody></table><h2 id="integrity-anti-tampering" tabindex="-1">Integrity &amp; Anti-Tampering <a class="header-anchor" href="#integrity-anti-tampering" aria-label="Permalink to &quot;Integrity &amp; Anti-Tampering&quot;">​</a></h2><p>Indicates potential attacks or environmental damage detected by the system.</p><table tabindex="0"><thead><tr><th>Error Code</th><th>Meaning</th><th>Solution</th></tr></thead><tbody><tr><td><strong>nativeMethods</strong></td><td><strong>Native methods tampered</strong>. Browser APIs (e.g., <code>console.info</code>, <code>Date</code>) hooked or modified by third-party scripts.</td><td>1. Disable interfering browser plugins; 2. Check if third-party monitoring SDKs rewrote native objects.</td></tr><tr><td><strong>comment</strong></td><td><strong>Signature node missing</strong>. The TechUI authorization comment at the end of the HTML was removed.</td><td>Do not use JS scripts to remove HTML comments; this is a mark of legitimate authorization.</td></tr><tr><td><strong>webSys</strong></td><td><strong>Host environment anomaly</strong>. Wasm cannot access <code>window</code> or <code>document</code> objects.</td><td>Check for unsupported browsers or non-standard WebViews.</td></tr><tr><td><strong>icoreStr</strong></td><td><strong>Core integrity compromised</strong>. Wasm internal core string constants were illegally modified.</td><td>Serious error usually caused by memory debuggers. Refresh the page.</td></tr><tr><td><strong>component</strong></td><td><strong>Component validation failed</strong>. Detected component tampering.</td><td>Usually caused by malicious code modification.</td></tr></tbody></table><h2 id="parsing-format" tabindex="-1">Parsing &amp; Format <a class="header-anchor" href="#parsing-format" aria-label="Permalink to &quot;Parsing &amp; Format&quot;">​</a></h2><p>Usually implies the input License string itself is corrupted.</p><table tabindex="0"><thead><tr><th>Error Code</th><th>Meaning</th><th>Solution</th></tr></thead><tbody><tr><td><strong>license</strong></td><td><strong>Primary license parsing failed</strong>. Format error, truncated, or signature check failed.</td><td>Re-copy the full License string from the email, ensuring no extra spaces.</td></tr><tr><td><strong>subLicense</strong></td><td><strong>Sub-license parsing failed</strong>. Sub-authorization segment format error.</td><td>Check if the generated sub-license configuration is correct.</td></tr></tbody></table><h2 id="prime-edition-exclusive" tabindex="-1">Prime Edition Exclusive <a class="header-anchor" href="#prime-edition-exclusive" aria-label="Permalink to &quot;Prime Edition Exclusive&quot;">​</a></h2><p>The following errors appear only when using the <code>@techui/prime</code> flagship edition.</p><table tabindex="0"><thead><tr><th>Error Code</th><th>Meaning</th><th>Solution</th></tr></thead><tbody><tr><td><strong>licenseKey</strong></td><td><strong>License key not found</strong>.</td><td>Check if the license key was passed.</td></tr><tr><td><strong>licenseDec</strong></td><td><strong>License key parsing error</strong>.</td><td>Check if the license key is correct.</td></tr><tr><td><strong>keychain</strong></td><td><strong>Keychain missing</strong>.</td><td>Execute <code>npm install @techui/prime-keychain</code> and ensure correct import.</td></tr><tr><td><strong>keyInChain</strong></td><td><strong>No matching key in keychain</strong>.</td><td>Check the <code>keychain</code> parameter in the initialization code.</td></tr><tr><td><strong>configParams</strong></td><td><strong>Configuration decryption failed</strong>.</td><td>Ensure Client Key and Keychain versions match.</td></tr><tr><td><strong>licCfgParams</strong></td><td><strong>Error in config key parameters</strong>.</td><td>Check if config parameters match the license key parameters.</td></tr><tr><td><strong>environment</strong></td><td><strong>Production environment limit</strong>. <code>NODE_ENV=production</code> detected in unauthorized mode.</td><td>Prime edition prohibits production builds without authorization. Configure a formal license.</td></tr></tbody></table><div class="tip custom-block github-alert"><p class="custom-block-title">TIP</p><p><strong>Quick Positioning</strong>: Type <code>tuiCoreInfo()</code> in the dev console to view the <code>VALIDSTATUS</code> object. Any item marked <code>false</code> is the cause of the meltdown.</p></div>',19)])])}const p=e(i,[["render",d]]);export{m as __pageData,p as default};
